import RSVP from '../Main/RSVP';
import React from 'react';
import Travel from '../Main/Travel';
import Wedding from '../Main/Wedding';
import { PAGES } from '../constants';

function Main(props) {
  return (
    <div className="main">
      <>
        {props.screen === PAGES.RSVP ? <RSVP name={props.name} /> :
          props.screen === PAGES.WEDDING ? <Wedding /> :
            props.screen === PAGES.TRAVEL ? <Travel /> : null
        }
      </>
    </div>
  )
}

export default Main;
